import React, { useState } from 'react';
import logo from '../assets/inflight-logo.png';
import PieChartFood from './PieChartFood';
import PieChartBeverage from './PieChartBeverage';
import BarChartComponent from './BarChartComponent';
import RouteLineChart from './RouteLineChart';
import AgeGroupDetails from './AgeGroupDetails';
import RouteFilter from './RouteFilter';
import RouteInsightBox from './RouteInsightBox';

const Dashboard = () => {
  const [selectedFlight, setSelectedFlight] = useState('');
  const [showQuarterly, setShowQuarterly] = useState(false);

  const handleSearch = () => {
    if (selectedFlight) setShowQuarterly(true);
  };

  const handleBack = () => {
    setShowQuarterly(false);
    setSelectedFlight('');
  };

  return (
    <div style={{ padding: '1.5rem', background: 'linear-gradient(to bottom right, #e6f7ff, #d7ffe3)', minHeight: '100vh' }}>
      {/* Navigation */}
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img src={logo} alt="In-Flight Insights Logo" style={{ height: '60px', marginRight: '1rem' }} />
          <h1 style={{ fontSize: '1.8rem', color: '#007bff' }}>‚úàÔ∏è In-Flight Insights Dashboard</h1>
        </div>
        <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem' }}>
          <input
            type="text"
            placeholder="Search Flight Route"
            value={selectedFlight}
            onChange={(e) => setSelectedFlight(e.target.value)}
            style={{ padding: '8px', borderRadius: '4px', border: '1px solid #ccc' }}
          />
          <button onClick={handleSearch} style={{ padding: '8px 12px', backgroundColor: '#007bff', color: '#fff', border: 'none', borderRadius: '4px' }}>
            Search
          </button>
          <div style={{ display: 'flex', gap: '1rem' }}>
            <a href="#" style={{ textDecoration: 'none', color: '#007bff' }}>Dashboard</a>
            <a href="#" style={{ textDecoration: 'none', color: '#007bff' }}>Reports</a>
            <a href="#" style={{ textDecoration: 'none', color: '#007bff' }}>Settings</a>
            <a href="#" style={{ textDecoration: 'none', color: '#007bff' }}>Profile</a>
          </div>
        </div>
      </div>

      {/* KPI Cards */}
      <div style={{ display: 'flex', justifyContent: 'space-between', marginTop: '2rem', gap: '1rem' }}>
        {[
          { icon: 'üí∞', title: 'Cost Savings', value: '$1.2M' },
          { icon: '‚ôªÔ∏è', title: 'Waste Saved', value: '210 kg' },
          { icon: '‚úàÔ∏è', title: 'Routes Analyzed', value: '350' },
          { icon: 'üåç', title: 'CO‚ÇÇ Saved', value: '28 tonnes' }
        ].map((kpi, idx) => (
          <div key={idx} style={{ flex: 1, background: 'linear-gradient(to right, #e0ffe0, #e0f7ff)', padding: '1.2rem', borderRadius: '12px', boxShadow: '0 2px 6px rgba(0,0,0,0.08)', textAlign: 'center' }}>
            <h3 style={{ fontSize: '1.1rem' }}>{kpi.icon} {kpi.title}</h3>
            <p style={{ fontSize: '1.6rem', fontWeight: 'bold', marginTop: '0.5rem' }}>{kpi.value}</p>
          </div>
        ))}
      </div>

      {/* Quarterly Chart - Conditionally Rendered */}
      {showQuarterly && (
        <div style={{ marginTop: '2rem' }}>
          <RouteLineChart selectedRoute={selectedFlight} />
          <button onClick={handleBack} style={{ marginTop: '1rem', padding: '8px 16px', backgroundColor: '#ff4d4f', color: '#fff', border: 'none', borderRadius: '6px' }}>
            Back
          </button>
        </div>
      )}

      {/* Route Filter */}
      <div style={{ textAlign: 'center', marginTop: '1.5rem' }}>
        <RouteFilter />
      </div>

      {/* Chart Section */}
      <div style={{ display: 'flex', marginTop: '2rem', gap: '2rem' }}>
        {/* Pie Charts */}
        <div style={{ flex: 1, backgroundColor: '#f9f9f9', padding: '1.5rem', borderRadius: '12px' }}>
          <h2 style={{ textAlign: 'center', marginBottom: '1rem' }}>Consumption Breakdown</h2>
          <div style={{ display: 'flex', justifyContent: 'space-around' }}>
            <div>
              <h3 style={{ textAlign: 'center' }}>Food</h3>
              <PieChartFood />
            </div>
            <div>
              <h3 style={{ textAlign: 'center' }}>Beverages</h3>
              <PieChartBeverage />
            </div>
          </div>
        </div>

        {/* Waste Trend Chart */}
        <div style={{ flex: 1 }}>
          <RouteLineChart />
        </div>
      </div>

      {/* Bar Chart */}
      <div style={{ marginTop: '2rem' }}>
        <BarChartComponent />
        <AgeGroupDetails />
      </div>

      {/* Route Specific Waste Breakdown */}
      <div style={{ marginTop: '2rem' }}>
        <RouteInsightBox />
      </div>
    </div>
  );
};

export default Dashboard;
